import React from 'react'

export default function NoteItem(props) {
  return (
      <div>
        <div className="card">
          <div className="card-body">
            <h5 className="card-title">{props.title}</h5>
            <p className="card-text">
              {props.description}
            </p>
            <i className="fa-solid fa-trash" style={{color: "#ff0000"}}></i>
            
          </div>
        </div>
      </div>
  )
}
